using System.Collections.Generic;
using Xunit;

namespace TaleSpire.Slab.Tests
{
    /// <summary>
    /// Tests for slabs.
    /// </summary>
    public class SlabTests
    {
        [Theory]
        [MemberData(nameof(Slabs))]
        public void When_ParseSlabs_Expect_AssetCount(string slabString, int assets)
        {
            var slab = Slab.Import(slabString);

            // count the number of assets
            var layoutSlab = Assert.IsAssignableFrom<ILayoutSlab>(slab);
            int count = 0;
            foreach (var layout in layoutSlab.Layouts)
                count += layout.AssetCount;
            Assert.Equal(assets, count);
        }

        [Theory]
        [MemberData(nameof(Slabs))]
        public void When_ParseSlabsAndExport_Expect_Original(string slabString, int assets)
        {
            var slab = Slab.Import(slabString);
            string ownExport = slab.Export();
            var newslab = Slab.Import(ownExport);
            Assert.Equal(slab, newslab);
        }

        /// <summary>
        /// Gets the slab data to be tested.
        /// </summary>
        public static IEnumerable<object[]> Slabs
        {
            get
            {
                // Mountain Board – The Mount St Mikkel
                // Author: Istallri
                // Source: https://talestavern.com/slab/mountain-board/
                yield return new object[]
                {
                    "",
                    4052
                };

                // Small Cave For The New Dragon
                // Author: Gengus
                // Source: https://talesbazaar.com/prefab/2342
                yield return new object[]
                {
                    "",
                    1774
                };
            }
        }
    }
}
